  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:47.081644\",\n\t\"name\": \"the-tree-crushing-program-on-the-kenai-national-moose-range\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report outlines the tree-crushing
  program at Kenai National Wildlife Refuge. Efforts to control vegetation on Kenai
  National Wildlife Refuge for the benefit of moose began in the 1950u2019s. Large
  scale attempts began in 1961 after two D-7 caterpillars were obtained on surplus.
  By 1968, at least 6,000 acres had been crushed, mainly in the Slikok Lake 1926 burn
  area. During 1973 and 1974, a research proposal was approved to study the effects
  of crushing and burning in the Willow Lake area and funds were obtained to operate
  the tree crushers again. Approximately 1.7% of the estimated moose habitat on the
  refuge has been crushed since the refuge was established.\",\n\t\"license_title\":
